# Definition for singly-linked list.
# class ListNode(object):
#	 def __init__(self, x):
#		 self.val = x
#		 self.next = None

class Solution(object):
	def sortList(self, head):
		"""
		:type head: ListNode
		:rtype: ListNode
		"""
		def sortListHelper(head):
			if not head: return None, None  
			p = head.next
			smaller = None
			larger = None
			equal = head
			pivot = head.val
			# smallerCount, largerCount, equalCount = 0, 0, 0
			# print 'pivot', pivot
			while p:
				pnext = p.next
				# print p.val, pivot
				if p.val < pivot:
					# put to smaller list
					p.next = smaller
					smaller = p
					# smallerCount += 1
				elif p.val > pivot:
					p.next = larger
					larger = p
					# largerCount += 1
				else: # p.val == pivot
					p.next = equal
					equal = p
					# equalCount += 1

				p = pnext
				
			# now we get head, smaller and larger
			# print smallerCount, largerCount, equalCount
			smallerHead, smallerTail = sortListHelper(smaller)
			largerHead, largerTail = sortListHelper(larger)
			equalHead, equalTail = equal, head # head must be tail of equal

			if smallerTail:
				smallerTail.next = equalHead
			
			equalTail.next = largerHead 
			return smallerHead or equalHead, largerTail or equalTail
		
		return sortListHelper(head)[0]

